MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "Power Aware simulation enables you to perform functional verification of low-power designs together with the power management structure defined by your power intent. The tool supports Power Aware simulation for VHDL and Verilog designs in both register transfer level (RTL) and gate-level simulation (GLS). ");
MGCAddSnippet(5, "Verilog and VHDL designs make the fundamental assumption that all logic is powered on at the beginning of simulation and remains powered on throughout simulation. ");
MGCAddSnippet(6, "To apply Power Aware simulation on your design, use your conventional QuestaSIM simulation flow, along with some power-specific arguments to the vopt and vsim commands, and with a power intent specification written using the Unified Power Format (UPF) defined in IEEE Std 1801. ");
MGCAddSnippet(7, "The purpose of the manual is to provide information on how to run a Power Aware simulation in the QuestaSIM simulator. ");
MGCAddSnippet(8, "Power Aware simulation augments normal HDL simulation capabilities with the ability to specify, model, and simulate the effects of active power management logic that is added to the design.");
MGCAddSnippet(9, "Power Aware simulation requires your design, power intent, and optionally, Liberty details.");
MGCAddSnippet(10, "You invoke Power Aware simulation with the same commands used for conventional QuestaSIM simulation, although the optimization (vopt) and simulation (vsim) commands have additional arguments specific to Power Aware. ");
MGCAddSnippet(11, "Use the standard three-step, two-step, and PDU-based simulation flow of the tool for Power Aware simulation. Apart from the standard flows, you can use the Power Aware interactive mode. ");
MGCAddSnippet(12, "In a three-step flow, you compile, optimize, and simulate your design in three separate steps. ");
MGCAddSnippet(13, "In a PDU-based simulation flow, you optimize your IP or macro so that you can use the optimized model (pre-optimized design unit, or PDU) in larger blocks. ");
MGCAddSnippet(14, "During development or debugging, if you make any change in the UPF file, you need to rerun the vopt command. Rerunning the vopt command requires reloading the design, which is time consuming. Power Aware simulation supports the Power Aware interactive mode, which enables you to load a design once and then apply the UPF specification multiple times.");
MGCAddSnippet(15, "In a two-step flow, you compile and simulate your design. The simulator implicitly optimizes the design before simulation. This flow may be useful in certain cases, such as automated scripts that assume only two steps are involved in building and running a simulation. You can pass optimization or UPF processing options to the optimization engine via the simulator.");
MGCAddSnippet(16, "Power Aware simulation exhibits features, which are either enabled by default or you need to enable them using commands and arguments.");
MGCAddSnippet(17, "Use the -pa_enable and -pa_disable arguments of the vopt command to enable or disable the Power Aware features.");
MGCAddSnippet(18, "An isolation cell ensures that the logical and electrical interactions between the source of a signal and the receiver are correct. It prevents power-down regions of a design from propagating unknown values to the rest of the design. Power Aware simulation implements isolation by inserting a cell into the design where isolation is required.");
MGCAddSnippet(19, "A level shifter cell is required whenever a signal crosses a source power domain operating at a voltage level that is different from the voltage level of the sink power domain.");
MGCAddSnippet(20, "Retention saves the value of a design element in a power domain before switching off the power to that element. When power is restored to that element, the value is retained. Based on the retention control signals specified in the UPF specification, Power Aware simulation automatically selects a model for retention.");
MGCAddSnippet(21, "Retention saves the value of a design element in a power domain prior to switching off the power to that element. The value is restored when power to the element is turned on.");
MGCAddSnippet(22, "Based on the retention control signals specified in the UPF specification, Power Aware simulation automatically selects a model for retention. A Power Aware simulation provides default Verilog models for retention cells that support both edgesensitive and level-sensitive detection of input control signals for save and restore functions.");
MGCAddSnippet(23, "Power Aware simulation provides models for retention cells that support both edge-sensitive and level-sensitive detection. Based on the retention control signals in the UPF specification, Power Aware simulation automatically selects the model. An example of a single control, level-sensitive model illustrates the use of the UPF retention command with level-sensitive controls.");
MGCAddSnippet(24, "The set_isolation and set_level_shifter UPF commands each have -source and -sink options, which you can use to apply isolation or level shifting only to certain paths of a specific port in your design. When you specify either or both of these options, Power Aware simulation identifies all the paths through the given port and applies isolation or level shifting to only those paths whose driver and receiver supplies match the specified source and sink supplies. ");
MGCAddSnippet(25, "Use the set_isolation command to isolate ports. ");
MGCAddSnippet(26, "Power Aware simulation uses information from a Power State Table (PST) for Power Aware analysis.");
MGCAddSnippet(27, "Power Aware simulation uses information from a Power State Table (PST) for Power Aware analysis. PSTs are also parsed and dumped to the PST Analysis Report (report.pst.txt). It is assumed that the PST is complete; any domains that are not mentioned in PST are not used for analysis.");
MGCAddSnippet(28, "PSTs provide static information about the relationships between different supplies used in power management. This information is used for the determination of operating voltage for level shifter placements and static checks for isolation and level shifter cells.");
MGCAddSnippet(29, "States of ports and nets carry voltage and on/off information, which means combinations of power states of supply ports and/or nets are important in identifying the requirement of isolation cells and level shifters on boundaries between two power domains. Because a power state added on one domain/supply set can reference other power states added on another domain/supply set, the tool can statically infer such dependencies. These dependencies help in determining the combinations of power states of supply nets and/or ports. ");
MGCAddSnippet(30, "Use the -logic_expr or -supply_expr option of the UPF add_power_state command to determine whether power states of different power domains can co-exist.");
MGCAddSnippet(31, "Power Aware simulation generates numerous X values because of the CORRUPTION simstate. This introduces more chances to miss design issues by being too optimistic due to RTL x-optimism. To catch design issues related to X values earlier, run the vopt -xprop command as part of the three-step flow.");
MGCAddSnippet(32, "The bind_checker UPF command enables you to insert a checker module into a design without modifying the design code or introducing functional changes. You can verify your design by writing custom assertions and implementing coverage for UPF strategy elements. ");
MGCAddSnippet(33, "The tool disables the simulation semantics of a design instance for various reasons, and displays a message whenever it disables the simulation semantics. ");
MGCAddSnippet(34, "Power Aware simulation enables you to control the assertions present in the test bench or design instance during power-down.");
MGCAddSnippet(35, "A value conversion table (VCT) is a UPF definition (IEEE Std 1801) of how to convert, or map, a value from a supply net state relevant to an HDL variable type (and from an HDL variable type to a supply net state). This mapping enables complex modeling of connections between supply nets and RTL ports. ");
MGCAddSnippet(36, "Power Aware simulation automatically inserts VCT for pins detected as power and ground based on the set_domain_supply_net and supply_set functions.");
MGCAddSnippet(37, "Power Aware simulation follows new semantics for inserting the isolation, level shifter, and repeater cell. The tool applies isolation, level shifter, or repeater strategies on a per path basis in the design.");
MGCAddSnippet(38, "Power Aware simulation follows the precedence resolution rules defined in the IEEE Std 1801-2018, section 5.7, but there are some differences.");
MGCAddSnippet(39, "Use the -pa_upf, -pa_preupfile, and -pa_tclfile to specify files in the vopt command.");
MGCAddSnippet(40, "Power Aware simulation performs a variety of checks on your design that validate the power intent defined in the UPF file. These checks ensure that the power intent protocol violations do not occur because of a power event sequence or the power architecture.");
MGCAddSnippet(41, "Power Aware checks ensure that your design is compliant to the power intent defined in the UPF file. Power Aware checks use the power intent definition to report any missing or inconsistent power-related information, saving your time in simulation and synthesis debugging.");
MGCAddSnippet(42, "Isolation checks report any missing or inconsistent isolation cells in your design. Isolation is present in the design if the UPF file contains a set_isolation command defining an isolation strategy, or a set_isolation -instance strategy that specifies the need for isolation and points to the instantiated isolation cells.");
MGCAddSnippet(43, "Level shifter checks report any missing or inconsistent level shifter cells in your design. Level shifting is present in the design if the UPF file contains a set_level_shifter command defining a level shifting strategy, or a set_level_shifter -instance strategy that specifies the need for level shifting and points to the instantiated level shifting cells.");
MGCAddSnippet(44, "Path analysis checks report not analyzed and good paths for isolation and level shifter requirements. By default, the tool does not report path analysis checks, because there are many not analyzed and good paths for a power domain crossing.");
MGCAddSnippet(45, "Retention checks report various inconsistent retention conditions in your design. Retention is present in the design if the UPF file contains a set_retention command defining a retention strategy, or a set_retention -instance strategy that specifies the need for retention and points to the instantiated retention cells.");
MGCAddSnippet(46, "Back-to-back checks report back-to-back cells in your design. Replace the back-to-back cells with a single cell.");
MGCAddSnippet(47, "Use the vopt arguments to enable static RTL, static GLS, and dynamic checks. ");
MGCAddSnippet(48, "Static RTL checks validate your RTL design with the power intent defined in the UPF file. For static RTL checks, the tool analyzes the UPF file for power state tables (PSTs), power states added on power domains (by an add_power_state command), and supply sets. The purpose of this analysis is to detect the power domain relative ON/OFF condition and the relative operating voltages.");
MGCAddSnippet(49, "Static RTL isolation checks report any missing or inconsistent isolation cells in your RTL design.");
MGCAddSnippet(50, "Static RTL level shifter checks report any missing or inconsistent level shifter cells in your RTL design. ");
MGCAddSnippet(51, "Static RTL path analysis checks report any not analyzed path or good paths in your RTL design. ");
MGCAddSnippet(52, "Static RTL back-to-back checks report any back-to-back cells in your RTL design.");
MGCAddSnippet(53, "Static GLS checks validate your gate-level design with the power intent defined in the UPF file. For static GLS checks, the tool analyzes the UPF file for power state tables (PSTs), power states added on power domains (by an add_power_state command), and supply sets. The purpose of this analysis is to detect the power domain relative ON/OFF condition and the relative operating voltages.");
MGCAddSnippet(54, "Static GLS isolation checks report any missing or inconsistent isolation cells in your gate-level design. ");
MGCAddSnippet(55, "Static GLS level shifter checks report any missing or inconsistent level shifter cells in your gate-level design.");
MGCAddSnippet(56, "Static GLS retention checks report any inconsistent retention condition in your gate-level design.");
MGCAddSnippet(57, "Static GLS back-to-back checks report any back-to-back cells in your gate-level design.");
MGCAddSnippet(58, "Static GLS ELS checks report any issues in the ELS cells present in your gate-level design. ");
MGCAddSnippet(59, "Static GLS switch checks report any missing or inconsistent switch cells in your gate-level design.");
MGCAddSnippet(60, "Static GLS miscellaneous checks report various miscellaneous issues in your gate-level design.");
MGCAddSnippet(61, "Dynamic checks validate your design with the power intent defined in the UPF file during the Power Aware simulation.");
MGCAddSnippet(62, "Dynamic isolation checks report any missing or inconsistent isolation cells in your RTL and gate-level designs. ");
MGCAddSnippet(63, "Dynamic level shifter checks report any missing or inconsistent level shifter cells in your RTL and gate-level designs. ");
MGCAddSnippet(64, "Dynamic retention checks report any inconsistent retention condition in your RTL and gate-level designs.");
MGCAddSnippet(65, "Specify a value to the vopt -pa_checks command to enable dynamic miscellaneous checks.");
MGCAddSnippet(66, "The quick reference table provides values of the pa_checks argument for enabling various static RTL and dynamic checks.");
MGCAddSnippet(67, "Power Aware checks may require granular control than is provided by the values of the vopt pa_checks command or the arguments of the pa msg command. For granular control of the checks, create a Tcl file that contains the pa_checks or the pa msg commands, and then use this file to selectively enable or disable specific checks for a design or UPF object (such as isolation, level shifter, and retention).");
MGCAddSnippet(68, "Enable granular control of static RTL and dynamic checks by using a Tcl file, containing the pa_checks commands, with the vopt command.");
MGCAddSnippet(69, "Enable granular control of dynamic checks by invoking a Tcl file, containing the pa msg commands, at the VSIM prompt. You can also enter one or more pa msg commands directly at the VSIM prompt.");
MGCAddSnippet(70, "If a Tcl file contains multiple pa_checks or pa msg commands that apply to the same check, then the tool resolves the priority of the commands based on the precedence of arguments.");
MGCAddSnippet(71, "Use either the absolute or the relative pathname to specify the design or UPF objects in the arguments of the pa_checks and pa_msg commands.");
MGCAddSnippet(72, "Use the Results Analysis window of the QuestaSIM GUI to view the results of static checks after the vopt stage of your flow.");
MGCAddSnippet(73, "When you instruct the optimization step of the Power Aware flow to perform static checks, the output consists of a database file (report.static.tdb) containing information about your design. Use this database file to view the static check results in the Results Analysis window.");
MGCAddSnippet(74, "The Results Analysis window provides features that are specific to loading a report.static.tdb file. ");
MGCAddSnippet(75, "Power Aware simulation generates various reports and messages that you use to analyze and validate the power intent of your design. The tool generates the reports during optimization (with the vopt -pa_genrpt command), and the messages during runtime.");
MGCAddSnippet(76, "During optimization, the tool generates various Power Aware reports (at the pa_reports/ directory in the current working directory) depending upon the values that you provide to the vopt -pa_genrpt argument.");
MGCAddSnippet(77, "Use the -pa_genrpt argument with the vopt command to generate the Power Aware reports.");
MGCAddSnippet(78, "During runtime, the tool automatically generates Power Aware messages at the Transcript window.");
MGCAddSnippet(79, "Analyze Power Aware coverage to verify that the regression test suites are adequately testing the Power Aware elements of your design. ");
MGCAddSnippet(80, "Configure Power Aware simulation or non-Power Aware simulation to analyze your Power Aware and non-Power Aware coverage.");
MGCAddSnippet(81, "Generate coverage reports and a test plan to analyze your Power Aware and non-Power Aware coverage.");
MGCAddSnippet(82, "Configure the standard Power Aware simulation to generate Power Aware and combined coverage report. Generate these reports in either command line or from the GUI.");
MGCAddSnippet(83, "Configure non-Power Aware simulation with Power Aware simulation to generate Power Aware and combined coverage report. Generate these reports in either command line interface or from the GUI.");
MGCAddSnippet(84, "Use the Power Aware test plan either in an XML file, or in the Verification Management Tracker window of the simulator to analyze Power Aware coverage details. Also, you can add non-Power Aware coverage details in the test plan.");
MGCAddSnippet(85, "Power Aware simulation supports coverage of power states and transitions of various UPF objects, such as ports and nets, PSTs, supply sets, power domains, power switches, isolation strategies, retention strategies, control signals, and simstates. The tool also supports cross coverage of power states, which refers to the system-level coverage that is represented using the cross of various power states. ");
MGCAddSnippet(86, "Use the coverage exclude command to exclude any object within a particular hierarchical path from coverage statistics and coverage reports.");
MGCAddSnippet(87, "Power Aware information model is a data model to capture the power-management information, which is the result of application of UPF, Liberty, and HDL commands on your design. ");
MGCAddSnippet(88, "The Tcl interface enables you to access the Power Aware information model objects and its properties in a Tcl script or UPF file using the UPF 3.1 Tcl APIs. ");
MGCAddSnippet(89, "Run the UPF 3.1 Tcl APIs in the interactive mode to access the Power Aware information model objects and its properties.");
MGCAddSnippet(90, "Power Aware simulation supports the syntax and semantics of the UPF 3.1 Tcl APIs, also called as UPF query commands, as defined by IEEE Std 1801-2018, Section 11.1.2.");
MGCAddSnippet(91, "Checks if the object handle belongs to a specified class. ");
MGCAddSnippet(92, "Returns the string representing the hierarchical pathname of an object in the Power Aware database, relative to the given scope. ");
MGCAddSnippet(93, "Returns a string containing the value of the specified property (keyword) on an object in the Power Aware database. ");
MGCAddSnippet(94, "Returns the type of an object in the Power Aware database. ");
MGCAddSnippet(95, "The HDL interface enables you to access the Power Aware information model objects and its properties directly in a test bench or simulation model using the UPF 3.1 HDL package functions.");
MGCAddSnippet(96, "The simulator supports the syntax and semantics of various HDL package functions defined by IEEE Std 1801-2018, Section 11.2.3.");
MGCAddSnippet(97, "The simulator supports various native HDL representation defined by IEEE Std 1801.");
MGCAddSnippet(98, "Use the UPF 3.1 HDL package functions with the SystemVerilog functional coverage constructs, such as covergroups and coverpoints, for efficient Power Aware coverage. The HDL package functions enable you to write fast and reliable Power Aware coverage infrastructure, and perform random and directed Power Aware simulation. Random because the test scenarios are developed by generic scripts, and directed because the coverage covers very specific scenarios.");
MGCAddSnippet(99, "Use the UPF 3.1 HDL package functions to write Power Aware assertions in your test bench.");
MGCAddSnippet(100, "Use windows in the QuestaSIM graphical user interface (GUI) to obtain a visual display of your Power Aware design and simulation. ");
MGCAddSnippet(101, "The Objects, Structure, and Wave windows provide visibility into UPF objects.");
MGCAddSnippet(102, "The Objects, Source, Structure, and Wave windows includes special Power Aware-specific information.");
MGCAddSnippet(103, "This task describes how to display UPF objects in the Structure, Objects, and Wave windows of the graphical user interface.");
MGCAddSnippet(104, "The Source window allows you to analyze information about your design that is specific to Power Aware.");
MGCAddSnippet(105, "Use this menu choice to locate names of UPF signals in your Source window.");
MGCAddSnippet(106, "Use this context menu to perform Power Aware actions for a selected signal.");
MGCAddSnippet(107, "Use this element to access navigation tools and preference options for signal drivers.");
MGCAddSnippet(108, "You can perform debugging at the same time you run a Power Aware simulation by adding the debugdb argument to both the vopt and vsim commands. The results of both the Power Aware analysis and the debug operation are provided as Power Aware schematic in the Schematic window. You can also view a correlation between the UPF power intent and the design display in the Schematic window. ");
MGCAddSnippet(109, "You can run Power Aware analysis and debugging from the top of the design (test bench) with or without specifying an optimized design unit. These methods resemble the conventional two-step and three-step optimization flows. ");
MGCAddSnippet(110, "You can run Power Aware analysis from the DUT hierarchy and debugging on the complete design. Running vopt -pa_top captures the DUT hierarchy for Power Aware analysis ");
MGCAddSnippet(111, "The Schematic window of the graphical user interface (GUI) provides various features that help you view debugging results from a Power Aware simulation.");
MGCAddSnippet(112, "You can use the Wave window to view bias mode, corruption, and isolation information for your design.");
MGCAddSnippet(113, "When using the conventional Wave window display, it can be difficult to see the effects of Power Aware simulation. For example, a zero on a signal may represent normal simulation behavior, it may be the result of an isolated port clamped to zero, or it may be corruption on a bit type. ");
MGCAddSnippet(114, "Enable Power Aware highlighting in the Wave window by altering your vopt and vsim commands and through the GUI preferences.");
MGCAddSnippet(115, "Because power domains are not limited to two states (ON or OFF) and multi-voltage capability allows designs to assign different voltage levels to different states, tracking combinations of states in different power domains has become increasingly difficult. ");
MGCAddSnippet(116, "A power state table (PST) defines the allowable combinations of power states of supply ports and netsthose combinations of states that can exist at the same time during simulation of the design. As a result, changing the power state supply port/nets changes the state of PST. ");
MGCAddSnippet(117, "The dynamic display of power states provides debugging capabilities you can use to verify power intent. ");
MGCAddSnippet(118, "Use the window to view a list of Power Aware state machines in the design with the hierarchical path of their creation after beginning a Power Aware simulation.");
MGCAddSnippet(119, "Use the window to view a state diagram of any of your Power Aware state machines.");
MGCAddSnippet(120, "Power Aware simulation applies the power intent on a gate-level, or a mixed RTL and gate-level design automatically.");
MGCAddSnippet(121, "A macro model is a block-level model in a design that has been optimized for power, area, or timing and has been silicon-tested. Defining the power intent for a macro model depends on whether you have access to its internal structure (logic and topology). If internal access is not available, you can specify power intent only on its external pinsthis is referred to as a hard macro. You can process hard macro models in various ways, depending upon whether they are Power Aware or not, and if not, how you want to add Power Aware behavior to the model.");
MGCAddSnippet(122, "The tool detects certain instances in the design as hard macro instances, and applies connection and corruption semantics. ");
MGCAddSnippet(123, "The simulation model for a hard macro is a normal functional model that does not include any power-related structures or Power Aware behavior. Such models are processed along with the design just like any other RTL or gate-level module. ");
MGCAddSnippet(124, "Hard macros often have multiple supplies that provide power to different portions of the macro. In such cases, implicit connection to the primary supply of the containing domain is not sufficient. ");
MGCAddSnippet(125, "It is sometimes convenient to have simulation models for hard macros that can be used in either normal simulation or Power Aware simulation without modification, without adding extra levels of hierarchy, and without leaving ports unconnected. An extended Power Aware simulation model makes this possible. ");
MGCAddSnippet(126, "A Liberty model for a hard macro is an alternative way of providing Power Aware behavior for instances of that hard macro. The Liberty model can be read along with a non-Power Aware HDL simulation model. Power-related attributes in the Liberty model essentially add Power Aware behavior to the non-Power Aware HDL model.");
MGCAddSnippet(127, "A macro model is a block-level model in a design that has been optimized for power, area, or timing and has been silicon-tested. Defining the power intent for a macro model depends on whether you have access to its internal structure (logic and topology). If internal access is not available, you can specify power intent only on its external pinsthis is referred to as a  hard macro.  ");
MGCAddSnippet(128, "Power Aware simulation identifies power management cells (isolation, level shifter, or retention) in the design, and matches them with a UPF strategy. It inserts power management cells when the cell is defined in the UPF strategy, but is missing in the design; it also applies connection and corruption semantics.");
MGCAddSnippet(129, "Power Aware simulation detects gate-level cells, and applies corruption semantics. ");
MGCAddSnippet(130, "Power Aware simulation detects sequential UDPs in the design and applies corruption or retention behavior based on the corresponding UPF strategies. ");
MGCAddSnippet(131, "Power Aware simulation uses the information present in the Liberty model to create a proper connection of the supplies and control signals that are defined in the UPF file. Also, Power Aware simulation uses the Liberty model to assist in automatic recognition of power management cells that are present in the design.");
MGCAddSnippet(132, "Liberty models define standard cells and macro cells that can be used in a system, and how power supplies provided to instances of such cells are used to power logic receiving inputs or driving outputs. Liberty models also include information pertaining to power management cells.");
MGCAddSnippet(133, "Specify the Liberty source files or the Liberty attribute library during the processing of the UPF file. ");
MGCAddSnippet(134, "Use the vopt command to create, update, and refresh Liberty attribute libraries. The Liberty attribute libraries enable you to specify Liberty cells during the processing of the UPF file.");
MGCAddSnippet(135, "Use the vopt command to parse the Liberty source files and create an attribute library containing information extracted from the Liberty source files. ");
MGCAddSnippet(136, "Update an existing Liberty attribute library with new information about Liberty cells. You update an existing library when a Liberty source file is edited to correct an error and needs to be reprocessed. ");
MGCAddSnippet(137, "If you created a Liberty attribute library with a previous version of the tool, you can refresh the attribute library to work with the recent version.");
MGCAddSnippet(138, "Debug your Power Aware Simulation with Power Aware apps, Questa TKGUI, or Visualizer Debug Environment.");
MGCAddSnippet(139, "Power Aware simulation enables you to create a database of information for analyzing the results in the QuestaSIM TKGUI after completion of a live simulation.");
MGCAddSnippet(140, "The debug database helps you to debug a Power Aware simulation that is run in a regression setup or where you are not able to debug a live simulation.");
MGCAddSnippet(141, "The tool provides debugging features that are available during a live simulation and post simulation mode.");
MGCAddSnippet(142, "Power Aware simulation enables you to create a database of information for analyzing the results in the Visualizer Debug Environment after completion of a live simulation.");
MGCAddSnippet(143, "The debug database helps you in post-simulation debug. Create the appropriate design and waveform database files that are required by Visualizer for post-simulation debug.");
MGCAddSnippet(144, "Visualizer has various debug features, and most of the features are available by default.");
MGCAddSnippet(145, "Power Aware apps are simulator-specific, Tcl-based APIs. With Power Aware debugging apps, including your own, you can catch bugs earlier in the design, determine the impact of low-power issues, and access UPF objects.");
MGCAddSnippet(146, "Power Aware apps are simulator-specific, Tcl-based APIs. Using Power Aware debugging apps, you can catch bugs earlier in the design cycle, address low-power issues, and more readily access and manipulate UPF objects.");
MGCAddSnippet(147, "Run the Power Aware apps in Visualizer Debug Environment for reporting, debugging, and checking purposes. Use the predefined Power Aware apps or create your own Power Aware apps.");
MGCAddSnippet(148, "An example usage of the Power Aware apps is to find the source of a corrupt signal.");
MGCAddSnippet(149, "An example usage of the Power Aware apps is to report selected Power Aware information, such as finding an isolation strategy whose isolation control is corrupted.");
MGCAddSnippet(150, "Power Aware simulation supports various UPF and Tcl commands. The UPF commands are a part of the IEEE Std 1801 to express the power management architecture of a design. The Tcl commands are specific to the tool, which you specify in either a UPF or Tcl file.");
MGCAddSnippet(151, "Power Aware simulation supports various UPF commands, options and attributes to express the power management architecture of a design. It also supports various query commands to obtain Power Aware information about the design.");
