MGCAddSnippet(237, "Changes the corruption extent of the power domains created by the UPF file. ");
MGCAddSnippet(238, "Enables conversion functions to be treated as feedthroughs for UPF-based corruption. The objective is to detect conversion functions in the PA-RTL and treat them as feedthrough paths. ");
MGCAddSnippet(239, "Specifies the VCT to be used for pins of any particular pg_type attribute. ");
MGCAddSnippet(240, "Enables associating an instance signal pin or a hierarchical port with specific supply nets. Thus, you can create a supply net based on supply pins to specify your related supplies of cells. ");
MGCAddSnippet(241, "Power Aware verification uses Verilog behavioral models of power management cells. These models encapsulate the Power Aware behaviors of various types of design state, such as clock-low retention flip-flops and active-high retention latches. ");
MGCAddSnippet(242, "Model vendors can implement the Verilog model in any style. The cells communicate important events to the simulator using named events. Power Aware verification defines a standard set of named event identifiers that are used in the model. Each named event corresponds to a particular action to be taken by the simulator. ");
MGCAddSnippet(243, "The following declarations of named events in a Power Aware Verilog model control simulator activity as indicated. ");
MGCAddSnippet(244, "To assist in the identification of power management cells and facilitate their mapping inferred sequential elements, attributes are placed within the module to provide easily located information. The attributes names and allowed values, as well as contexts in which they are used, are as specified.");
MGCAddSnippet(245, "The model must define the necessary ports using the names as specified in this section. All ports are required even if the optional functionality does not apply to a specific inferred register or latch. This port interface specification allows generic models that can be applied to a variety of inferred registers and latches. ");
MGCAddSnippet(246, "You can use these examples as a base for creating your own models.");
MGCAddSnippet(247, "This appendix provides supplemental information on applications of Power Aware. ");
MGCAddSnippet(248, "This section contains an application note written by Ping Yeung and Erich Marschner of Mentor Graphics Corporation. ");
MGCAddSnippet(249, "Power dissipation has become a key constraint for the design of today s complex chips. Minimizing power dissipation is essential for battery-powered portable devices, as well as for reducing cooling requirements for non-portable systems. Such minimization requires active power management built into a device.");
MGCAddSnippet(250, "The continual scaling of transistors and the end of voltage scaling has made power one of the critical design constraints in the design flow. ");
MGCAddSnippet(251, "Active power management can be thought of as having three major aspects:");
MGCAddSnippet(252, "Several power management techniques are used to minimize power dissipation: clock gating, power gating, voltage scaling, and body biasing are four of them. ");
MGCAddSnippet(253, "The power management architecture for a given design could be defined as part of the design, and ultimately it is a part of the design s implementation. A better approach, however, is to specify the power management architecture separate from the design. ");
MGCAddSnippet(254, "In order to employ active power management techniques such as power gating and multiple voltage supplies, the design must be partitioned into separate functional areas that can be independently powered. Additional logic must be inserted into the design to perform special functions such as power switching, state retention, isolation, and level shifting. These additional components constitute the power management architecture for a given system. ");
MGCAddSnippet(255, "With the power management architecture implemented on top of the design, it should be possible to repeatedly power up each power domain and later power it down again. Each time a domain is powered up, it should reach a well-defined state from which to continue its operations. That state may be the initial reset state, or a state saved before the power domain was last powered down, or a combination of the two.");
MGCAddSnippet(256, "Power management may involve both software and hardware control. ");
MGCAddSnippet(257, "Verifying RTL-level specification of active power management for a given design involves several steps. ");
MGCAddSnippet(258, "Active power management is becoming a necessary part of today s SoC designs. To add active power management to a design and verify that it works correctly, it is critical to have a well-defined methodology that addresses all aspects of active power management. The methodology needs to support defining and verifying an appropriate power management architecture, verifying that the design behaves correctly under the power management architecture, and verifying that the power control signals controlling the power management architecture are generated correctly. IEEE Std 1801-2009 UPF supports such a methodology, as does static analysis of power management architecture, Power Aware simulation of power-managed designs, and formal verification of power control logic. These methods provide a comprehensive solution for defining and verifying active power management.");

